settings.cardCss:
.icon-title {
    position: absolute;
    font-family: 'Roboto', sans-serif; 
    font-size: 12px;
    font-weight: 800;
    color: #555;
    text-transform: uppercase;
    letter-spacing: 1px;
    transform: translate(-50%, -50%);
    white-space: nowrap;
    text-shadow: 1px 1px 2px white; /* Para que resalten sobre el fondo */
}
.scada-footer {
    display: flex;
    flex-direction: row; /* Pone los elementos en fila */
    justify-content: center; /* Los centra horizontalmente */
    align-items: flex-end; /* Alinea al fondo */
    gap: 15px; /* Espacio entre burbujas */
    width: 100%;
    position: absolute;
    bottom: 10px;
    left: 0;
}
.stat-bubble {
    background: white;
    padding: 10px 15px;
    border-radius: 25px; 
    box-shadow: 0 4px 8px rgba(0,0,0,0.1);
    display: flex;
    flex-direction: column; /* Texto arriba, valor abajo */
    align-items: center;
    min-width: 90px;
    position: relative;
}

/* El texto  */
.label-tag {
    font-size: 9px;
    font-weight: 800;
    color: #7f8c8d;
    margin-bottom: 2px;
}

.value-text {
    font-size: 14px;
    font-weight: bold;
}

/* Colores  */
.solar { color: #f1c40f; }
.wind  { color: #3498db; }
.batt  { color: #2ecc71; }
.house { color: #2c3e50; }
.grid  { color: #e74c3c; }
.auto  { color: #9b59b6; }

.label {
    position: absolute;
    background: rgba(255, 255, 255, 0.95);
    border-radius: 20px;
    padding: 6px 15px;
    font-weight: bold;
    box-shadow: 0 4px 10px rgba(0,0,0,0.1);
    transform: translate(-50%, -50%);
    z-index: 10;
}
path {
    stroke-dasharray: 10; /* Tamao de los segmentos de la lnea */
    animation: flujoEnergia 2s linear infinite;
}

@keyframes flujoEnergia {
    from {
        stroke-dashoffset: 100;
    }
    to {
        stroke-dashoffset: 0;
    }
}
